💧Just because there is an increase in heat and humidity, it’s still important to continue using a moisturizer daily. If your skin is getting oilier with the warmer temps, consider switching to a lighter formula like an oil-free lotion. But, be sure your day lotion has SPF if you're not already layering it under your moisturizer
💧 Water is most often the best way to stay hydrated. Water contains no added sugar, making it ideal to drink throughout the day or specifically when you need to rehydrate.
💧 Fruits and veggies that contain 80-99% water are a healthy way to get extra water into your body.
💧 Consider adding a supplement to your water. Hydrators contain essential electrolytes that help to rehydrate as you lose essential vitamins and minerals.
💧 Avoid dehydrating drinks. Coffee, tea, and energy drinks zap your hydration away. Caffeine is a natural diuretic which is known to cause dehydration when overused.

